import '../styles/Footer.css';

function Footer() {
  return(
    <div id="footerBar">
      <a href="https://github.com/KIMOISQUIGGLES" target="_blank" class="h">GitHub</a>
      <a href="https://www.linkedin.com/in/tylerjamesalcover/" target="_blank">LinkedIn</a>

    </div>
  );
    
  }
  
  export default Footer;
